def activity_03():
    st.subheader("PARTE EXPERIMENTAL:") 
    st.markdown("**Objetivo:** estimar o valor da constante 𝜋 através de uma análise gráfica.")
    st.markdown("""**Material necessário:** 
                - 04 objetos em formato circular de diferentes diâmetros; 
                - 01 fita métrica ou barbante e régua""") 
    st.markdown("**Procedimentos:**")
    st.write("1) Ordene os objetos em ordem crescente de diâmetro;")
    st.write("2) Meça o comprimento da circunferência e o diâmetro de cada objeto.")
    st.write("Anote os respectivos valores na Tabela 1. ")

    # Selectbox para escolher o grupo ou todos
    opcao = st.selectbox(
        "Selecione o grupo:",
        ["Todos", "Grupo 1", "Grupo 2", "Grupo 3", "Grupo 4"]
    )

    # Função auxiliar para entrada de dados de um grupo
    def entrada_grupo(nome):
        st.subheader(nome)
        medidas = []
        for i in range(4):
            col1, col2 = st.columns(2)
            diam = col1.number_input(f"Diâmetro {i+1} ({nome})", min_value=0.0, step=0.1, key=f"{nome}_d{i}")
            circ = col2.number_input(f"Circunferência {i+1} ({nome})", min_value=0.0, step=0.1, key=f"{nome}_c{i}")
            if diam > 0 and circ > 0:
                medidas.append((diam, circ))
        return medidas

    # Função para plotar gráfico com ajuste linear
    def plotar(dados, nome):
        if len(dados) < 2:
            st.warning(f"{nome}: insira pelo menos 2 medidas.")
            return
        diametros = np.array([d for d, _ in dados])
        circunfs = np.array([c for _, c in dados])

        # Ajuste linear (reta C = a*D)
        a, b = np.polyfit(diametros, circunfs, 1)
        pi_estimado = a  # coef. angular ≈ π

        fig, ax = plt.subplots()
        ax.scatter(diametros, circunfs, color="blue", label="Medidas")
        ax.plot(diametros, a*diametros+b, color="red", label=f"Ajuste linear (π≈{pi_estimado:.3f})")
        ax.set_xlabel("Diâmetro (cm)")
        ax.set_ylabel("Circunferência (cm)")
        ax.set_title(nome)
        ax.legend()
        st.pyplot(fig)

    # --- Lógica de exibição ---
    if opcao == "Todos":
        # Linha 1: Grupo 1 e Grupo 2
        col1, col2 = st.columns(2)
        with col1:
            g1 = entrada_grupo("Grupo 1")
        with col2:
            g2 = entrada_grupo("Grupo 2")

        # Linha 2: Grupo 3 e Grupo 4
        col3, col4 = st.columns(2)
        with col3:
            g3 = entrada_grupo("Grupo 3")
        with col4:
            g4 = entrada_grupo("Grupo 4")

        grupos = {"Grupo 1": g1, "Grupo 2": g2, "Grupo 3": g3, "Grupo 4": g4}

    else:
        grupos = {opcao: entrada_grupo(opcao)}

    # Exibir gráficos (sempre em sequência vertical)
    if st.button("Plotar gráfico"):
        for nome, dados in grupos.items():
            plotar(dados, nome)

